	VALUES(240111044331056579, UUID(), 14956, '深圳市',  14957, '福田区', '笔架山庄', '笔架山庄', '深圳市福田区梅岗南街5号', NULL, '深业笔架山庄座落于笔架山庄现麓，红会医院北侧，是深业集团投资兴建的商品住宅区。于1994年10月开始建设，占地面积16724平方米，建筑总面积31780平方米，绿地面积5800平方米，投资1.1亿元，1995年12月28日入伙，住宅区内有多层宅楼七栋，共有226户居住户居住单元，入住人员1000多人，住宅区内附设综合商场，建设筑面积4351平方米，住宅区内设有停车场，购物商场，休闲广场，区内绿化环境好，在住宅区附近有医院。肉菜市场，幼儿园、中、小学校等生活设施配套，笔架山庄是理想的居住场所。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
