	VALUES(240111044331056583, UUID(), 15629, '宜春市',  15630, '袁州区', '袁州区行政中心', '袁州区行政中心', '宜春市袁州区袁山东路', NULL, '宜春市袁州区行政中心是袁州区的政治、经济和文化中枢，于2010年12月建成投入使用。包括有行政中心主楼（东西主楼和裙楼）、会议中心、A附楼和B附楼、行政广场、袁州公园等区域。其中办公大楼是袁州区政府集多功能为一体的现代化办公大楼，占地面积26.85公顷，总建筑面积55964.7平方米，是党和政府的执政管理中心，也是社会公共服务中心。大楼前面的袁州公园，风景宜人，青翠欲滴，占地面积97600平方米，其中绿化面积约为5万平米，人工湖面积约为2.6万平米。公园全天候对外开放，是市民闲暇之时散步和休憩的好去处。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
