	VALUES(240111044331056585, UUID(), 15629, '宜春市',  15630, '袁州区', '宜春市烟草办公楼', '宜春市烟草办公楼', '宜春市袁州区宜阳路168号', NULL, '宜春烟草于2012年2月搬入新办公大楼，新办公大楼共17层，建筑面积共18334平方米。深业集团（深圳）物业管理公司宜春分公司于二0一四年十二月份通过招投标中标宜春市烟草办公楼，并于二0一五年二月十五日正式入驻，现大楼共有物业管理人员共33人，其中管理人员3人、机电工1人、安管员19人、保洁员10人,物业公司将对宜春市烟草办公楼进行为期三年的物业管理。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
