	VALUES(240111044331056587, UUID(), 15633, '吉安市',  15686, '吉州区', '吉安市行政中心大楼', '吉安市行政中心大楼', '吉安市吉州区行政中心大楼', NULL, '吉安市行政中心大楼位于吉安市城南新区空间主轴上的核心区块，位于冬青路以东，尚德大道以南，春兰路以西，崇文路以北。毗邻艺术中心、图书馆、妇女儿童活动中心、体育馆等。2015年，吉安市行政中心大楼被评为“2014年度吉安市物业管理示范大厦”荣誉称号；2016年，深业物业吉安分公司被评为“2015年度吉安市优秀物业服务企业”荣誉称号。吉安市行政中心大楼占地面积119536平方米，总建筑面积172600平方米。其中主楼建筑面积143273平方米（地上15层面积为121200平方米，地下1层面积为22043平方米）；附楼（地上5层）：档案、信访办公楼14570平方米，食堂后勤楼14804平方米；地下室停车场设有420个停车位，室外停车场设有471个停车位；主楼、附楼房间总数1800余间，主楼办公室使用面积33000平方米，会议室、接待室、档案室、计算机房、卫生间等公共服务用房26500平方米，设备及附属使用面积12500平方米，公共走道、门厅、电梯厅、墙体等非使用面积46200平方米，地下人防和车库22000平方米。吉安市行政中心大楼周边下设吉安行政中心周转房、吉安市民服务中心、城市展览馆与博物馆、图书馆、妇联与总工会。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
