	VALUES(240111044331056588, UUID(), 15633, '吉安市',  15790, '泰和县', '泰和县行政中心大楼', '泰和县行政中心大楼', '泰和县嘉禾大道行政中心大楼', NULL, '泰和县行政中心大楼位于龙江新区，盟鸥路以东，龙潭大道以南，泰和大道以西，嘉禾大道以北。泰和县行政中心大楼占地面积10248.92平方米，总建筑面积47423.79平方米（地上为39902.79平方米，地下为7521平方米），其中建筑主楼一幢，建筑面积38036.45平方米，附楼二幢,建筑面积8893.38平方米；多功能会议室（容纳600人）418平方米，视频会议室（容纳200人）370平方米，会议贵宾休息室3间，面积117.5平方米；外墙总面积6.98万平方米,干挂石材面积3.58万平方米,玻璃幕墙面积1.45万平方米。大楼周边道路1.7万平方米(含地上停车场),园林绿化面积6.8万平方米，行政中心前景观河长500米，上宽21米，下宽15米，起于盟鸥路止于泰和大道。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
