	VALUES(240111044331056589, UUID(), 15633, '吉安市',  15685, '永丰县', '永丰县行政中心大楼', '永丰县行政中心大楼', '行政中心大楼', NULL, '永丰县行政中心大楼位于新城区，永丰县行政中心大楼占地面积约50000平方米，总建筑面积34500平方米。主楼用于办公的有效使用面积约21600平方米。
永丰县行政中心主楼共13层，其中地上12层，地下1层。地上12层从下到上分别为1-12F，其功能为各部门、各单位的办公用房和会议室，在1F拟安排部分服务性行业用房。地下1层称-1F，有64个停车位，主要用于县四套班子的公务用车停放；地面有约100个停车位，主要用于各部门、各单位的私家车及来办事的单位和社会车辆的停放。
永丰县行政中心附楼2栋，其中：东附楼为103大会议室、物业办公室；西附楼为信访办、115会议室、208四套班子、207视频会议室。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
