由深业集团（深圳）有限公司和深圳华联企业联合兴建，1992年在香港成功发售，并于1993年12月31日竣工投入使用，1994年2月正式入伙，是94年深圳市十大样板工程之首，95年获得去昂建筑工程鲁班奖。

