	VALUES(240111044331056602, UUID(), 14956, '深圳市',  14957, '福田区', '深圳市关山月美术馆', '深圳市关山月美术馆', '深圳市福田区红荔西路6026号', NULL, '深圳市关山月美术馆占地8000 平方米，建筑面积 15100 平方米，展厅总面积 3600 平方米，户外展览面积 2000 平方米，固定展线 500 米，活动展线 500 米，共 1 个圆形中央展厅， 5个室内标准展厅和 2 个关山月艺术常设陈列厅。目前美术馆共有藏品5600 余件。经过近 20 年的运作，我馆成为国内外重要艺术交流平台和国家大型美术展览项目策划与承办机构，探索出一条以馆藏为基础，与深圳城市文化发展相适应的现代美术馆发展之路。2011 年被国家文化部评定为首批九家国家重点美术馆之一。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
