	VALUES(240111044331056604, UUID(), 14956, '深圳市',  15614, '坪山新区', '东晟时代花园', '东晟时代花园', '中山大道与锦龙大道交汇处', NULL, '深业东晟时代花园位于深圳市龙岗区坪山街道中心区西南侧、中山大道与锦龙大道交汇处；是坪山新区门户位置，来往市区、龙岗中心城与坪山之间的必经之路。4万多平米商业铺面及天虹商场的进驻，是坪山新区首个一线商业中心。深业东晟时代花园总占地面积72640.84平方米，总建筑面积279182平方米，由高层住宅组成的高尚住宅小区。其中住宅面积170970平方米，商业面积42736平方米；幼儿园：2400㎡ ，总户数为2247户（其中3号楼政府廉租房522户，已移交城建局）、商业户218户；由8栋楼15个单元组成，停车位2158个，绿化率30%，小区有幼儿园、社区活动室、地下停车场、商业等公共配套设施。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 31, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', 179900, 179901, UTC_TIMESTAMP(), 999992);
